import SearchBar from "./SearchBar"
import styles from './Nav.module.css'
import { Link } from "react-router-dom"

function Nav({onSearch}) {
    return (

        <div className={styles.navegacion}>
            <Link to='/'>
                <span>Landing</span>
            </Link>
            <Link to='/home'>
                <span>Home</span>
            </Link>
            <Link to='/about'>
                <span>About</span>
            </Link>

            <SearchBar onSearch={onSearch} />
        </div>
    )

}

export default Nav

